CREATE DEFINER=`root`@`localhost` PROCEDURE `best_worst_game_of_the_year`(
        IN input_year INT, 
    IN input_platform_id INT
)
BEGIN
    -- Combine Best and Worst Results in One Query
    (SELECT 'Best' AS Category, Name AS Game, Total_Sale 
     FROM Total_Sale
     WHERE year = input_year AND platform_id = input_platform_id
     ORDER BY Total_Sale DESC
     LIMIT 1)
    
    UNION ALL
    
    (SELECT 'Worst' AS Category, Name AS Game, Total_Sale 
     FROM Total_Sale
     WHERE year = input_year AND platform_id = input_platform_id
     ORDER BY Total_Sale ASC
     LIMIT 1);
END ;;
DELIMITER ;
